import React, { Component } from 'react';
import {
  HeaderWrapper,
  BrokerName,
  Subheader
} from './HeaderSection.styled.js';

class HeaderSection extends Component {
  constructor(props){
    super(props);
    this.state={};
  }

  render() {
    return (
      <HeaderWrapper>
        <BrokerName>{this.props.data.broker.name}</BrokerName>
        <div>
          <Subheader>Wesbite: </Subheader>
          <span>www.somecoolsite.com</span>
        </div>
        <div>
          <Subheader>Description:</Subheader>
          <span>{this.props.data.broker.description}</span>
        </div>
      </HeaderWrapper>
    );
  }
}

export default HeaderSection;
